import React from "react";
import Navigation from "../../../global-components/Navigation/Navigation";
import PageStyles from "../styles/active-user-styles.module.scss";
import { Link } from "react-router-dom";
import infoIcon from "../images/infoIcon.svg";
import PopularServicesList from "../../../global-components/PopularServicesList/PopularServicesList";
import MySubscriptionInfo from "../components/MySubscriptionInfo/MySubscriptionInfo";
import CatalogList from "../../../global-components/CatalogList/CatalogList";
import sampleBackground from "../images/sampleBackground.png"

function ActiveSubscription() {

    const sectionStyle = {
        backgroundImage: `url(${sampleBackground})`,
      };

  return (
    <div className={PageStyles.activeSubscriptionPageWrapper}>
        <section style={sectionStyle} className={PageStyles.activeSubscriptionLogoSection}><div className={PageStyles.activeSubscriptionNavWrapper}>


        <Navigation color="primary" pageName={""} backgroundColor="#FFFFFF" borderRadius="60px"/>
        </div>
        </section>

        <div className={PageStyles.activeSubscriptionBasicWrapper}>
            <div className={PageStyles.activeSubscriptionBasicInfo}>
                <h1>Иви</h1>
                <p>Подписка Изи Иви</p>
            </div>

            <div className={PageStyles.activeSubscriptionCashback}>
                <span>кешбэк 10 %</span>
            </div>

            <div className={PageStyles.activeSubscriptionNext}>
                <p>Следующее списание через 28 дней</p>
            </div>
        </div>
    </div>
  );
}

export default ActiveSubscription;
